import React, { Component } from 'react';

class SearchInfo extends Component {

    handleFromChange(e) {
        this.props.onFromChange(e.target.value)
    }
    handleToChange(e) {
        this.props.onFromChange(e.target.value)
    }
    handleDateChange(e) {
        this.props.onFromChange(e.target.value)
    }
    render(){
        const searchParams = this.props.searchParams;
        return (
            <div>
                <input type="text" name="From" value={searchParams.from} onChange={(searchParams.from)}/>
                <input type="text" name="To" value={searchParams.to}/>
                <input type="text" name="Date" value={searchParams.date}/>
                <button onClick={(searchParams) => this.props.onSearchClick(searchParams)}>Search</button>
            </div>

        )
    }
}
export default SearchInfo;
